Created and Story by Joe Brusha, Ralph Tedesco, and Raven Gregory
Written by Dan Wickline
Pencils by AC Osorio
Colors by Erick Arciniega
Letters by Jim Campbell

The Headless Horseman has returned and those who are responsible for his murder are in for a terrifying surprise. As the guilt continues to torture Ty for his part in his friend's murder, he starts seeing things that may or may not be there. Meanwhile, Craig's headless body has returned to seek his vengeance and he will stop at nothing to get it! From the minds of Ralph Tedesco, Joe Brusha and Raven Gregory, written by Dan Wickline (30 Days of Night), this is one horror series you do not want to miss!

